import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h2 className="primary-color">Notes App</h2>
            <div>
                <Link to="/">Home</Link>
                <Link to="*">New Note</Link>
            </div>
        </nav>
     );
}

export default Navbar;
